import styled from 'styled-components';

export const StyledStartButton = styled.button`
    box-sizing: border-box;
    min-height: 30px;
    width: 100%;
    margin-left: -40px;
    padding: 20px;
    border: 4px solid #333;
    border-radius: 20px; 
    color: black;
    background: pink;
    font-family: Georgia
    outline: none;
    font-size: 1.2rem;
    cursor: pointer;
`
